<section class=""content history "">

    <div class=""wrapper"">
        <div class=""top"">
            <div class=""title"">
                <h1>ESMT Berlin Scholarships for Women - Short Programs</h1>
                <p class=""text-red"">26 October, 2014</p>
            </div>
        </div>
        <div class=""contentone"">
            <div class=""tabs"">
                <div class=""tab"">
                    <input type=""radio"" name=""css-tabs"" id=""tab-1"" checked class=""tab-switch"">
                    <label for=""tab-1"" class=""tab-label"">Description</label>
                    <div class=""tab-content"">
                        ESMT Berlin is offering several executive education scholarships to promote women in leadership positions.

                        Program areas include career transition, product and project management, technology management, and leadership development. Applications can be submitted now.

                        Full scholarships are available for the Executive Transitio");
            WriteLiteral(@"n Program (ETP) valued at €24,900, and the General Management Seminar (GMS, held in German), valued at €18,500. These scholarships are aimed at female executives who, for example, lead a business unit, are responsible for a product launch, or are involved in international projects. Qualified candidates may apply until May 31, 2020.

                        In cooperation with the 30% club, a global initiative for gender equality seeking to increase the number of women in executive positions, ESMT provides another 50 percent scholarship for the Bringing Technology to Market Program (deadline March 31, 2020) and two additional 50 percent scholarships for the ETP (deadline May 31, 2020).

                        “As one of the world’s leading providers of executive education, ESMT takes its responsibility to advance diversity in leadership very seriously,” says Harald Hungenberg, dean of executive education at the international business school. “By awarding these scholarships we are able to accompany many ta");
            WriteLiteral(@"lented women on their career paths and help increase the number of female executives at our client companies.”
                    </div>
                </div>
                <div class=""tab"">
